// import logo from './logo.svg';
import Home from './pages/Home';
import './App.css';

import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <div>
      <Router>
        <Switch>
          <Home />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
